    console.log(`SUBMIT  ${values}`);
  }
  return (
    <Formik>
      <form onSubmit={() => console.log("teste submit")}>
        <Label>Nome:</Label>
        <Control>
          <Field name="name" type="text" />
        </Control>
        <Button color="info" type="submit">
          Salvar
        </Button>
      </form>
    </Formik>
  );
}

export default BookForm;

